import React, { useState } from "react";
import { Component } from "react";
import { useEffect } from "react";
import Player from "../Player";


 function PlayMe({accessToken, playingTrack, setPlayingTrack}){  
  
   
  return(
    <div>
      <Player accessToken ={accessToken} trackUri={playingTrack?.uri} setPlayingTrack={setPlayingTrack}/>
    </div>
  )
  
 }

 export default PlayMe;
